import styled from "styled-components";
import {Header} from "antd/lib/layout/layout";
import {Typography} from "antd";

export const HeaderTextStyled = styled(Typography)`
  color: aliceblue;
  font-size: 30px;
  text-shadow: 1px 1px 1px antiquewhite;
`
